import React from 'react'
import { Link } from 'react-router-dom'
import BasketballIcon from 'react-icons/IoBasketballOutline'
import TeamComparison from 'react-icons/MdPeople'
import CompareIcon from 'react-icons/MdCompareArrows'
import SinglePlayer from 'react-icons/MdPerson'
import PlayerStatistics from 'react-icons/VscGraph'

const navIcons = [
    {
        title: 'Home',
        icon: BasketballIcon,
        path: '/Home'
    },
    {
        title: 'Player',
        icon:PlayerStatistics,
        path: '/Player'
    },
    {
        title: 'Player-Comparison',
        icon: CompareIcon,
        path: '/Player-Comparison'
    },
    {
        title: 'Team-Comparison',
        icon: TeamComparison,
        path: '/Team-Comparison'
    }
]

export default function Sidebar() {
    return (
        <div className = "sidebar-container">
            <ul>    
            { navIcons.map((link, index) => (
                <li key ={index}>
                    <Link to={link.path}> link.title </Link>
                </li>
            ))}
            </ul>
        </div>
    )
}
